  verifyKardexLineList(action, instance, actionService) {
    //#768, if Same part number is used multiple times and available quanitiy is 1
    // then change template name to "BYD_COM_HOLD_3" before create requisition
    let kardexArr = [];
    let lineArr = [];
    let temp = [];
    let removeIndexArr = [];
    let isLineObjEqual;
    let isKardexObjEqual;

    //Check for kardex data availibility
    if(action.config.kardexLineData && action.config.kardexLineData != undefined){
      temp = this.contextService.getDataByKey(action.config.kardexLineData);
      //Cloning Array values, to prevent modifing original Array List.
      kardexArr = cloneDeep(temp);
      
      // resetting value for further use.
      temp = [];
    }

    //Check for line data availibility
    if(action.config.lineListData && action.config.lineListData != undefined){
      temp = this.contextService.getDataByKey(action.config.lineListData);
      //Cloning Array values, to prevent modifing original Array List.
      lineArr = cloneDeep(temp);
      
    }

    if (kardexArr.length > 1) {
      for (let i = 0; i < kardexArr.length; i++) {

        for (let j = i + 1; j < kardexArr.length; j++) {
          isLineObjEqual = false;
          isKardexObjEqual = false;

          //Below Condition is checking for Same part items in Kardex List
          if (kardexArr[i].partNumber == kardexArr[j].partNumber) {

            //Below condition will check for order in kardex and linelist to be sync
            if (kardexArr[i].partNumber == lineArr[i].partNumber && kardexArr[j].partNumber == lineArr[j].partNumber) {

              //Below, two objects of array getting compare in form of String, result will be true or false.
              isKardexObjEqual = (kardexArr[i].isSubstituted == kardexArr[j].isSubstituted) &&
                (kardexArr[i].partId == kardexArr[j].partId) &&
                (kardexArr[i].partNumber == kardexArr[j].partNumber) &&
                (kardexArr[i].srcLocation == kardexArr[j].srcLocation) &&
                (kardexArr[i].srcOwner == kardexArr[j].srcOwner) &&
                (kardexArr[i].srcWarehouse == kardexArr[j].srcWarehouse) &&
                (kardexArr[i].availQuantity == kardexArr[j].availQuantity);

              isLineObjEqual = (lineArr[i].compLocation == lineArr[j].compLocation) &&
                (lineArr[i].condition == lineArr[j].condition) &&
                (lineArr[i].defectName == lineArr[j].defectName) &&
                (lineArr[i].financialCode == lineArr[j].financialCode) &&
                (lineArr[i].itemBCN == lineArr[j].itemBCN) &&
                (lineArr[i].owner == lineArr[j].owner) &&
                (lineArr[i].partNumber == lineArr[j].partNumber) &&
                (lineArr[i].priority == lineArr[j].priority);

              //Below condition needs to comment out as getting effected by quantity change for previous iterations
              // isKardexObjEqual = JSON.stringify(kardexArr[i]) === JSON.stringify(kardexArr[j]);
              // isLineObjEqual = JSON.stringify(lineArr[i]) === JSON.stringify(lineArr[j]);

              //If Line list and Kardex list in same order and part items then format arrays
              //if two part item, then add quanity to one item and remove other item.
              if (isKardexObjEqual && isLineObjEqual) {
                //Pushing index of object which needs to be removed.
                removeIndexArr.push(j);

                //Increasing Quantity count of current kardex and lineList Items
                kardexArr[i].quantity = kardexArr[i].quantity + kardexArr[j].quantity;
                lineArr[i].quantity = "" + (parseInt(lineArr[i].quantity) + parseInt(lineArr[j].quantity));
              }
            }

            if (kardexArr[i].availQuantity == 1) {
              //add templateName context to "BYD_COM_HOLD_3" as per requirement for #786
              if (action.config.templateKey && action.config.templateKey != undefined) {
                this.contextService.addToContext(action.config.templateKey, "BYD_COM_HOLD_3");
              }
            }
          }
        }
      }

      //Below inline function is to filter array for unique index
      function uniqueArray2(arr) {
        var a = [];
        for (var i = 0, l = arr.length; i < l; i++)
          if (a.indexOf(arr[i]) === -1 && arr[i] !== '')
            a.push(arr[i]);
        return a;
      }

      removeIndexArr = uniqueArray2(removeIndexArr);
      
      //Sorting below array to prevent any mismatch of index
      removeIndexArr.sort((a, b) => a - b);
      
      //Removing object from kardex and lineList array.
      //below operation is in reverse order so index won't be affected for rest of the element to be removed.
      if (removeIndexArr.length > 0) {
        for (let i = removeIndexArr.length - 1; i >= 0; i--) {
          kardexArr.splice(removeIndexArr[i], 1);
          lineArr.splice(removeIndexArr[i], 1);
        }

        //If Array is updated, then update the same in context.
        this.contextService.addToContext("LinelistPayload", lineArr);
        this.contextService.addToContext("kardexlistPayload", kardexArr);
      }
    }
    //If Array is not updated, then update the existing in context.
    this.contextService.addToContext("LinelistPayload", lineArr);
    this.contextService.addToContext("kardexlistPayload", kardexArr);
  }

