  defectNoteFormat(action, instance, actionService) {
    let defectNoteFormatAction = [];
    let key = action.config.key;
    let reqPart = action.config.reqPart || "";
    let kitPart = action.config.kitPart || "";
    let corePart = action.config.corePart || "";
    let tempStr = "";
    let mode = action.config.mode || "addpart";

    if (reqPart.startsWith('#')) {
      reqPart = this.contextService.getDataByString(reqPart);
    }

    if (kitPart.startsWith('#')) {
      kitPart = this.contextService.getDataByString(kitPart);
    }

    if (corePart.startsWith('#')) {
      corePart = this.contextService.getDataByString(corePart);
    }

    if(reqPart && mode == "addpart"){
      if(reqPart != kitPart){
        corePart = reqPart;
      }
      tempStr = reqPart + ";" + kitPart + "(" + corePart + ")";
    } else if(reqPart && mode == "verifyKit"){
      // tempStr = newCorePart
      let newCorePart = action.config.newCorePart || "";
      
      if (newCorePart.startsWith('#')) {
        newCorePart = this.contextService.getDataByString(newCorePart);
      }

      if(Array.isArray(corePart)){
        corePart = corePart.join(",");
      }

      tempStr = reqPart + ";" + kitPart + "(" + corePart + ", " + newCorePart + ")";
    }

    if(tempStr){
      this.contextService.addToContext(key, tempStr);
    }

    defectNoteFormatAction.forEach((element) => {
      actionService.handleAction(element, instance);
    });
  }


