  //Repair Assessment Action
  bsodTestValueFormat(action, instance, actionService){

    let data = [];

    if(action.config && action.config.data){
      if(action.config.data.startsWith('#')){
        data = this.contextService.getDataByString(action.config.data); 
      } else {
        data = action.config.data;
      }
    }

    if(data && data.length > 0){
      let tempStr = "";
      let tempArr = [];

      for (let i = 0; i < data.length; i++){
        tempArr.push(data[i]["value"]);
      }

      tempStr = tempArr.join(";");
      
      if(tempStr && tempStr != ""){
        this.contextService.addToContext(action.config.key, tempStr);
      } else {
        this.contextService.addToContext(action.config.key, "");
      }
    }
  }
